import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

import {
  SignIn,
  SignUp,
  ConnectSignIn,
  ProjectManage,
  ProjectList,
  ProjectAdd,
} from "./components/independent/auth/Auth";
import {
  Issue,
  ConferenceRoom,
  ConferenceDocument,
  WebRTCRoom,
  ConferenceDocumentDetail,
} from "./components/independent";

import { Navbar, Menu, Chat } from "./components/common";
import { Welcome } from "./components/independent/welcome/Welcome";

import PostTest from "../src/services/postTest";

class App extends Component {
  componentDidMount() {}
  render() {
    return (
      <Router>
        <div className="App">
          <Navbar />
          <div className="content-container">
            <div className="wrapper">
              <Menu />
              <Route
                exact
                path="/auth/signIn"
                render={(props) => (
                  <React.Fragment>
                    <SignIn />
                  </React.Fragment>
                )}
              />
              <Route
                exact
                path="/auth/signUp"
                render={(props) => (
                  <React.Fragment>
                    <SignUp />
                  </React.Fragment>
                )}
              />
              <Route
                exact
                path="/"
                render={(props) => (
                  <React.Fragment>
                    <Welcome />
                  </React.Fragment>
                )}
              />
              <Route path="/home/issue" component={Issue} />
              <Route path="/auth/connectSignIn" component={ConnectSignIn} />
              <Route path="/auth/projectManage" component={ProjectManage} />
              <Route path="/auth/projectAdd" component={ProjectAdd} />
              <Route path="/auth/projectList" component={ProjectList} />
              <Route
                path="/home/conferenceRoom/:projectId"
                component={ConferenceRoom}
              />
              <Route path="/room/:roomTokenId" component={WebRTCRoom} />
              <Route
                exact
                path="/home/conferenceDocument/:projectId"
                render={(props) => (
                  <React.Fragment>
                    <ConferenceDocument />
                  </React.Fragment>
                )}
              />

              <Route
                path="/home/conferenceDocument/conferenceDocumentDetail/:projectId"
                component={ConferenceDocumentDetail}
              />
              <Route path="/postTest" component={PostTest} />

              <Chat />
            </div>
          </div>
        </div>
      </Router>
    );
  }
}

export default App;
